// SPDX-License-Identifier: MIT

pragma solidity 0.8.3; 

import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol';

contract QD is Ownable, ERC20 {
    using SafeERC20 for ERC20;

    // NEAR NEP141s have this precision 
    uint constant internal _QD_DECIMALS        = 24                            ;
    uint constant internal _USDT_DECIMALS      = 6                             ;
    uint constant public   SALE_LENGTH         = 54 days                       ;
    uint constant public   MINT_QD_PER_DAY_MAX = 500_000                       ;

    // In cents
    uint private_price                                                         ;
    uint constant public start_price           = 22                            ;
    uint constant public final_price           = 96                            ;

    // Set in constructor and never changed
    ERC20 immutable public usdt                                                ;
    uint  immutable public sale_start                                          ;

    event Mint       (address indexed reciever, uint cost_in_usd, uint qd_amt) ;
    event Withdrawal (address indexed owner, uint amount)                      ;

    constructor(ERC20 _usdt) ERC20("QuiD", "QD") {
        // Data validation
        require(
            keccak256(abi.encodePacked(_usdt.symbol()))
            ==
            keccak256(abi.encodePacked("USDT"))
        , "QD: CONSTRUCTOR_R1");

        private_price = 2;
        sale_start = block.timestamp; // Putin attacks Kiev, night of 25.02.22
        usdt = _usdt;
    }

    function mint(uint qd_amt, address beneficiary) external returns (uint cost_in_usdt) { 
        require(qd_amt >= 100_000_000_000_000_000_000_000_000, "QD: MINT_R1"); // $100 minimum
        require(block.timestamp < sale_start + SALE_LENGTH, "QD: MINT_R2"); // April 20, 2022
        if (_msgSender() == owner()) {
            require(private_price < start_price, "Can't allocate any more");
            uint minting = 2_700_000_000_000_000_000_000_000_000_000; // from 2 cents to 20 (incl) 
            // we can mint 2.7M ten times to mirror the total that can be minted (500k * 54 days)
            cost_in_usdt = minting * 10 ** _USDT_DECIMALS * private_price / 10 ** _QD_DECIMALS / 100; 
            private_price += 2;
        } else {
            // Calculate cost in USDT based on current price
            cost_in_usdt = qd_amt_to_usdt_amt(qd_amt, block.timestamp);
        }
        // Optimistically mint
        _mint(beneficiary, qd_amt);

        // Cap minting
        require(totalSupply() <= get_total_supply_cap(), "QD: MINT_R3");

        // Will revert on failure (namely insufficient allowance)
        usdt.safeTransferFrom(_msgSender(), address(this), cost_in_usdt);

        emit Mint(_msgSender(), cost_in_usdt, qd_amt);
    }

    function withdraw(uint amount) external onlyOwner {
        require(block.timestamp > sale_start + SALE_LENGTH, "QD: MINT_R2");
        usdt.safeTransfer(owner(), amount);
        emit Withdrawal(owner(), amount);
    }

    function decimals() public view override(ERC20) returns (uint8) {
        return uint8(_QD_DECIMALS);
    }

    function get_total_supply_cap() public view returns (uint total_supply_cap) {
        uint time_elapsed = block.timestamp - sale_start;
        total_supply_cap = MINT_QD_PER_DAY_MAX * 10 ** _QD_DECIMALS * time_elapsed / 1 days;
    }

    function qd_amt_to_usdt_amt(
        uint qd_amt,
        uint block_timestamp
    ) public view returns (uint usdt_amount) 
    {
        uint time_elapsed = block_timestamp - sale_start;

        // price = ((now - sale_start) // SALE_LENGTH) * (final_price - start_price) + start_price
        uint price = (final_price - start_price) * time_elapsed / SALE_LENGTH + start_price;

        // cost = amount / qd_multiplier * usdt_multipler * price / 100
        usdt_amount = qd_amt * 10 ** _USDT_DECIMALS * price / 10 ** _QD_DECIMALS / 100;
    }
}
